// FROM https://numbas.mathcentre.ac.uk/extensions/230/edit_source?filename=graph-theory.js
Numbas.addExtension('graph-theory',['jme'],function(extension) {
    const scope = extension.scope;

    const connected_components = extension.connected_components = function(adjacency) {
        let components = adjacency.map((_,i) => i);
        for(let i=0;i<components.length;i++) {
            for(let j=0;j<components.length;j++) {
                if(i!=j && adjacency[i][j]) {
                    const keep = Math.min(components[i],components[j]);
                    const remove = Math.max(components[i],components[j]);
                    components = components.map(function(c) { return c==remove ? keep : c; });
                }
            }
        }
        const dict = {};
        components.forEach((c,i) => {
            if(dict[c]===undefined) {
                dict[c] = [];
            }
            dict[c].push(i);
        });
        return Object.values(dict);
    }

    const is_connected = extension.is_connected = function(adjacency) {
        return connected_components(adjacency).length<=1;
    }

    const subgraph = extension.subgraph = function(adjacency,verts) {
        const m =verts.map(function(a) {
            return verts.map(function(b) {
                return adjacency[a][b];
            })
        });
        m.rows = m.columns = verts.length;
        return m;
    }

    const largest_connected_component = extension.largest_connected_component = function(adjacency,labels) {
        const components = connected_components(adjacency);
        let biggest = [];
        for(let c of components) {
            if(c.length>biggest.length) {
                biggest = c;
            }
        }
        const oa = subgraph(adjacency,biggest);
        const ol = labels ? biggest.map(i=>labels[i]) : undefined;
        return {adjacency: oa, labels: ol};
    }

    const adjacency_matrix_from_edges = extension.adjacency_matrix_from_edges = function(edges,directed) {
        let size = 0;
        for(let [v1,v2] of edges) {
            size = Math.max(v1+1,Math.max(v2+1,size));
        }
        const m = [];
        for(let i=0;i<size;i++) {
            const row = [];
            for(let j=0;j<size;j++) {
                row.push(0);
            }
            m.push(row);
        }
        edges.forEach(function(e) {
            const [i,j] = e;
            m[i][j] = 1;
            if(!directed) {
                m[j][i] = 1;
            }
        });
        m.rows = m.columns = size;
        return m;
    }

    /** Create lists of nodes and links for cola
     * @param {Array.<Array.<boolean>>} m - the adjacency matrix; m[i][j] is true-ish if there is an edge between nodes i and j.
     * @returns {Object.<nodes,links>}
     */
    const from_adjacency_matrix = extension.from_adjacency_matrix = function(m) {
        const nodes = [];
        const links = [];
        for(let i=0;i<m.length;i++) {
            const w = 2;
            nodes.push({x:Math.random(),y:Math.random(), width: w, height: w});
        }
        for(let i=0;i<m.length;i++) {
            for(let j=0;j<i;j++) {
                if(m[i][j]) {
                    links.push({source:i,target:j,weight:1})
                }
            }
            if(m[i][i]) {
                nodes.push({x:Math.random(),y:Math.random(), width: 0.2, height: 0.2});
                links.push({source:i,target:nodes.length-1,weight:0.1})
            }
        }
        return {nodes,links};
    }

    const draw_graph = extension.draw_graph = function(graph) {
        const draw = SVG();

        /** Draw an arrow between a and b
         */
        function arrow(a,b) {
            let dx = b.x-a.x;
            let dy = b.y-a.y;
            const d = Math.sqrt(dx*dx+dy*dy);
            const l = 0.5;
            const w = 0.4;
            let [nx,ny] = [-dy,dx];
            dx *= l/d;
            dy *= l/d;
            nx *= w/d;
            ny *= w/d;
            const [cx,cy] = [(a.x+b.x)/2, (a.y+b.y)/2];
            return draw.polygon([[cx+dx,cy+dy],[cx-dx+nx,cy-dy+ny],[cx-dx/2,cy-dy/2],[cx-dx-nx,cy-dy-ny]]);
        }

        let {nodes,adjacency,labels} = graph;
        labels = labels || [];
        for(let i=0;i<adjacency.length;i++) {
            labels[i] = ((labels[i] || '')+'').trim();
        }
        let minx=Infinity,miny=Infinity,maxx=-Infinity,maxy=-Infinity;
        let extra = 0;
        for(let i=0;i<adjacency.length;i++) {
            for(let j=0;j<=i;j++) {
                const forward = adjacency[i][j];
                const backward = adjacency[j][i];
                if(forward || backward) {
                    const a = nodes[i];
                    const b = nodes[j];
                    let curve;
                    if(i==j) {
                        const c = nodes[adjacency.length+extra];
                        extra+=1;
                        const dx = c.x-a.x;
                        const dy = c.y-a.y;
                        const d = Math.sqrt(dx*dx+dy*dy);
                        const r = 2;
                        curve = draw.circle(r).center(a.x+dx/d*r/2,a.y+dy/d*r/2);
                    } else {
                        curve = draw.line(a.x, a.y, b.x, b.y);
                    }
                    let label;
                    if(forward && backward) {
                        label = `Edge between vertices ${labels[i]} and ${labels[j]}`;
                    } else if(forward) {
                        arrow(a,b);
                        label = `Edge from vertex ${labels[i]} to vertex ${labels[j]}`;
                    } else {
                        arrow(b,a);
                        label = `Edge from vertex ${labels[j]} to vertex ${labels[i]}`;
                    }
                    curve.fill('none').stroke({width:0.5,color:'white'}).attr({role:'img'});
                    if(labels[i] && labels[j]) {
                        curve.attr({'aria-label': label});
                    }
                    const top = curve.clone();
                    top.addTo(draw);
                    top.fill('none').stroke({width:0.1,color:'black'})
                    if(Math.max(forward,backward)<1) {
                        top.stroke({'dasharray':'0.5 0.5'});
                    }
                }
            }
        }

        const real_nodes = nodes.slice(0,adjacency.length);

        real_nodes.forEach((n,i) => {
            minx = Math.min(minx,n.x);
            miny = Math.min(miny,n.y);
            maxx = Math.max(maxx,n.x);
            maxy = Math.max(maxy,n.y);
            const c = draw.circle(1).center(n.x,n.y).attr({role:'img'});
            const label = ((labels[i] || '')+'').trim();
            if(label) {
                c.attr({'aria-label':'Vertex labelled '+label});
            }
        })

        if(labels) {
            real_nodes.forEach((n,i) => {
                const label = (labels[i]+'').trim();
                if(labels[i]===undefined || label=='') {
                    return;
                }
                let nx = 0;
                let ny = 0;
                adjacency[i].forEach(function(a,j) {
                    if(i!=j && a) {
                        const n2 = nodes[j];
                        const dx = n2.x-n.x;
                        const dy = n2.y-n.y;
                        const d = dx*dx+dy*dy;
                        nx += dx/d;
                        ny += dy/d;
                    }
                });
                if(nx==0 && ny==0) {
                    nx = 1;
                    ny = 1;
                }
                const nd = Math.sqrt(nx*nx+ny*ny);
                const r = 1.5;
                const [cx,cy] = [n.x-r*nx/nd,n.y-r*ny/nd];
                const t = draw.text(label).font({size:1,anchor:'top'}).center(cx,cy);
                const b = t.bbox();
                const pad = 0;
                t.before(draw.line(cx,cy,n.x,n.y).stroke({width:0.05,color:'gray'}));
                t.before(draw.ellipse(b.w+2*pad,b.h+2*pad).move(b.x-pad,b.y-pad).fill('white'))
            })
        }

        const margin = 4;
        draw.viewbox(minx-margin,miny-margin,maxx-minx+2*margin,maxy-miny+2*margin)

        return draw.node;
    }

    const layout_graph = extension.layout_graph = function(graph) {
        const {nodes,links} = graph;
        const adaptor = cola.adaptor({})
            .avoidOverlaps(true)
            .linkDistance(5)
        //    .jaccardLinkLengths(5)
        ;
        adaptor.nodes(nodes);

        adaptor.links(links)

        adaptor.start();
        const t1 = new Date();
        while(!adaptor.tick() && (new Date())-t1<100) {
        }

        return adaptor.nodes();
    }

    const vertex_degrees = extension.vertex_degrees = function(m) {
        const degrees = [];
        for(let i=0;i<m.rows;i++) {
            let d = 0;
            for(let j=0;j<m.columns;j++) {
                d += m[i][j] != 0 ? 1 : 0;
            }
            degrees.push(d);
        }
        return degrees;
    }

    const graph_union = extension.graph_union = function(m) {
        for(let i=1;i<arguments.length;i++) {
            const b = arguments[i];
            const n = [];
            n.rows = m.rows + b.rows;
            n.columns = m.columns + b.columns;
            for(let y=0;y<m.rows+b.rows;y++) {
                const row = [];
                n.push(row);
                for(let x=0;x<m.columns+b.columns;x++) {
                    let a = 0;
                    if(x<m.columns && y<m.rows) {
                        a = m[y][x];
                    } else if(x>=m.columns && y>=m.rows) {
                        a = b[y-m.rows][x-m.columns];
                    }
                    row.push(a);
                }
            }
            m = n;
        }
        return m;
    }

    const cartesian_product = extension.cartesian_product = function(m) {
        for(let i=1;i<arguments.length;i++) {
            const b = arguments[i];
            const n = [];
            const sm = m.rows;
            const size = m.rows*b.rows;
            console.log(size,m.rows,b.rows);
            n.rows = n.columns = size;
            for(let y=0;y<size;y++) {
                const row = [];
                n.push(row);
                const yk = (y-(y%sm))/sm;
                for(let x=0;x<size;x++) {
                    const xk = (x-(x%sm))/sm;
                    let a = b[yk][xk] && (x%sm)==(y%sm) ? 1 : 0;
                    if(xk==yk) {
                        a = m[y-yk*sm][x-xk*sm];
                    }
                    row.push(a);
                }
            }
            m = n;
        }
        return m;
    }

    const direct_product = extension.direct_product = function(m) {
        for(let i=1;i<arguments.length;i++) {
            const b = arguments[i];
            const n = [];
            const sm = m.rows;
            const size = m.rows*b.rows;
            console.log(size,m.rows,b.rows);
            n.rows = n.columns = size;
            for(let y=0;y<size;y++) {
                const row = [];
                n.push(row);
                const yk = (y-(y%sm))/sm;
                for(let x=0;x<size;x++) {
                    const xk = (x-(x%sm))/sm;
                    let a = b[yk][xk] && m[y%sm][x%sm] ? 1 : 0;
                    row.push(a);
                }
            }
            m = n;
        }
        return m;
    }


    const adjacency_permutation = extension.adjacency_permutation = function(p,m) {
        const n = m.map(function(row,y) { return row.map(function(c,x) { return m[p[y]][p[x]]; }) });
        n.rows = m.rows;
        n.columns = m.columns;
        return n;
    }

    const is_graph_isomorphism = extension.is_graph_isomorphism = function(p,m) {
        if(p.length != m.rows) { 
            return false;
        }
        const pm = adjacency_permutation(p,m);
        for(let y=0;y<m.rows;m++) {
            for(let x=0;x<m.columns;x++) {
                if(m[y][x] - pm[y][x]!=0) {
                    return false;
                }
            }
        }
        return true;
    }

    /** To cover:
     *
     * Folding graphs
     */

    scope.addFunction(new Numbas.jme.funcObj('adjacency_matrix',['list of list of number'],Numbas.jme.types.TMatrix,function(edges) {
        const m = adjacency_matrix_from_edges(edges);
        return new Numbas.jme.types.TMatrix(m);
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('draw_graph_from_adjacency',['matrix','[list of string]'],Numbas.jme.types.THTML,function(m,labels) {
        const graph = from_adjacency_matrix(m);
        const lnodes = layout_graph(graph);
        const drawing = draw_graph({nodes: lnodes, adjacency: m, labels: labels});
        return new Numbas.jme.types.THTML(drawing);
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('draw_graph',['matrix','list of vector','[list of string]'],Numbas.jme.types.THTML,function(m,points,labels) {
        const nodes = points.map(function(p) {
            return {x:p[0], y:p[1]}
        });
        const {_,links} = from_adjacency_matrix(m);
        const drawing = draw_graph({nodes: nodes, adjacency: m, labels: labels});
        return new Numbas.jme.types.THTML(drawing);
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('layout_graph',['matrix'],Numbas.jme.types.TList,function(m) {
        const graph = from_adjacency_matrix(m);
        const nodes = layout_graph(graph);
        return new Numbas.jme.types.TList(nodes.map(function(n) { return new Numbas.jme.types.TVector([n.x,n.y]); }));
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('vertex_degrees',['matrix'],Numbas.jme.types.TList,function(m) {
        return Numbas.jme.wrapValue(vertex_degrees(m));
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('graph_union',['matrix','matrix'],Numbas.jme.types.TMatrix,function(a,b) {
        return new Numbas.jme.types.TMatrix(graph_union(a,b));    
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('adjacency_permutation',['permutation','matrix'], Numbas.jme.types.TMatrix,function(p,m) {
        return new Numbas.jme.types.TMatrix(adjacency_permutation(p.to,m));
    },{unwrapValues: true}));

    scope.addFunction(new Numbas.jme.funcObj('is_graph_isomorphism',['permutation','matrix'], Numbas.jme.types.TBool,function(p,m) {
        return is_graph_isomorphism(p.to,m);
    }));
});

